def parse_data(data_str):
    frames = []
    current_frame = []

    for line in data_str.split('\n'):
        if line.startswith('Results:'):
            if current_frame:
                frames.append(current_frame)
                current_frame = []
        else:
            current_frame.extend([float(value) for value in line.split()])

    if current_frame:  # 마지막 프레임 추가
        frames.append(current_frame)

    return frames

def show_frames(frames):
    for i, frame in enumerate(frames):
        array = np.array(frame).reshape((24, 32, 1))  # 24x32 크기로 변환
        plt.imshow(array, cmap='gray')  # 그레이스케일 이미지로 표시
        plt.title(f'Frame {i+1}')
        plt.colorbar()
        plt.show()


